    function parseKlinedata(data) {
        var tmpKlineChartData = {
            categoryData: [],//横轴数据，时间
            values: [], //纵轴数据，高开低收
            timestamp: [], //时间戳
            barVolume: []
        };
        var klinedatas=[];
        var klinebar = [];
        var klinetime = [];
        data = eval(data.KlineData);
        for (var i in data) {
            //获取时间,开盘，收盘，最低，最高数据，并存储到临时变量
            var item = [getTimeStr(data[i].Time),data[i].Open,data[i].Close,data[i].Low,data[i].High,data[i].Volume];
            klinedatas.push(item);
            klinetime.push(data[i].Time);
            klinebar.push(data[i].Volume);
        }
        //格式化为chart数据
        return splitData(klinedatas, klinetime, tmpKlineChartData, klinebar);
    }
    function parseLinedata(data) {
        var linedatas=[];
        var tmpKlineChartData = {
            categoryData: [],//横轴数据，时间
            values: [], //纵轴数据，高开低收
            timestamp: [], //时间戳
            barVolume: []
        };
        var linetime = [];
        var linebar = [];
        data = eval(data.MinData);
        for (var i =0;i<data.length;i++) {
            //获取时间,开盘，收盘，最低，最高数据，并存储到临时变量
            var item = [getTimeStr(data[i].Time),data[i].Price,data[i].Volume,data[i].Amount];
            linedatas.push(item);
            linetime.push(data[i].Time);
            linebar.push(data[i].Volume);
        }
        //格式化为chart数据
        return splitData(linedatas, linetime, tmpKlineChartData,linebar);
    }
    function splitData(rawData, timeData, outData, barData) {
        var categoryData = [];
        var values = [];
        var timestamp = [];
        var barVolume = [];
        for (var i = 0; i < rawData.length; i++) {
            //从rawData中删除日期，保存为横轴数据
            outData.categoryData.push(rawData[i].splice(0, 1)[0]);
            //将高开低收数据放入纵轴
            outData.values.push(rawData[i]);
            if(outData.barVolume){
                outData.barVolume.push(barData[i]);
            }
        }
        outData.timestamp = timeData;
        return outData;
    }
    function getTimeStr(tamp) {
        var newDate = new Date();
        newDate.setTime(tamp*1000);
        return formatDate(newDate);
    }
    function formatDate(inputDate) {
        var   year=inputDate.getFullYear();
        var   month=inputDate.getMonth()+1;
        var   date=inputDate.getDate();
        var   hour=inputDate.getHours();
        var   minute=inputDate.getMinutes();
        var   second=inputDate.getSeconds();
        //return   year+'-'+month+'-'+date+' '+hour+':'+minute+':'+second;
        return   year+'-'+month+'-'+date;
    }
